import React, { Fragment } from "react"

import "./form-input.scss"

const FormInput = ({ handleChange, ...otherProps }) => {
    return (
        <Fragment>
            <div>
                <input type={otherProps.type} placeholder={otherProps.name} className="form-input" onChange={handleChange} {...otherProps} />

                <input type={otherProps.type} placeholder="Display Name" className="form-input" onChange={handleChange} />
            </div>
        </Fragment>
    )
}

export default FormInput;
